import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import ProductList from './components/ProductList';
import Products from './components/Products';
import About from './components/About';
import Contact from './components/Contact';
import Cart from './components/Cart';
import './App.css';
import Blazer from './components/Images/Blazer_1.jpg';
import Sherwani from './components/Images/Sherwani_1.jpg';
import './App.css';


const App = () => {
  const products = [
  ];
  return (
    <Router>
      <div className="background"></div>
      <Header> 
        <img src={Blazer} alt="Elegant Blazer" className="homepage-image" />
        <img src={Sherwani} alt="Traditional Sherwani" className="homepage-image" />
      </Header>
      <div className="main-content">
        <Routes>
          <Route path="/" element={<ProductList products={products} />} />
          <Route path="/products" element={<Products />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/cart" element={<Cart />} />
        </Routes>
      </div>
      <Footer />
    </Router>
  );
};

export default App;
